import React from 'react'
import { Button, Form } from 'semantic-ui-react'

const FormExampleUnstackableGroup = () =>  {
  let submit
  return (

  <Form onSubmit={onSubmit}
        render={({ handleSubmit, form, submitting, pristine, values }) => {
          submit = handleSubmit
          return (
            <form id="exampleForm" onSubmit={handleSubmit}>

    <Form.Group widths={3}>
      <Form.Input label='Add URL' placeholder='https://www.company.com/product' />
    </Form.Group>
    <p>Or simply add manually details of the product</p>
    <Form.Group widths={2}>
     <Form.Input label='Brand' placeholder='Brand name' />
      <Form.Input label='Product' placeholder='Product name' />  
      <Form.Input label='Category' placeholder='ex. Clenser, shampo, mascara...' />
    </Form.Group>
    <Button type='submit' >Submit</Button>

)

 <div className="buttons">
                <button type="submit" disabled={submitting || pristine}>
                  Submit
                </button>
              </div>
              <pre>{JSON.stringify(values, 0, 2)}</pre>
            </form>
          )
        }}
      />

  )
}
export default FormExampleUnstackableGroup
